's likely unstable and that we DON\'T recommend that you use it in any production environment just yet.','http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/',0,1),('67',4,'2012-05-11 09:46:54','Magento Community 1.7 and Magento Enterprise 1.12 now available!','Learn more about the exciting new features and updates in these releases.','http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/',0,1),('68',4,'2012-06-20 18:54:07','Magento Community Edition 1.7.0.1 now available! ','We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.','http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/',0,1),('69',4,'2012-07-05 19:21:43','Important Security Update - Zend Platform Vulnerability','We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ','http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/',0,1),('70',4,'2012-11-19 20:27:42','Wrap up more holiday sales with financing','Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.','http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML',0,1),('71',4,'2012-12-07 11:22:30','Increase Your Sales With PayPal','Magento merchants using PayPal Express Checkout can help increase their sales on average 18%. It is one simple thing you can do right now to help boost your sales. Learn more.','http://www.magentocommerce.com/add-paypal?utm_source=CEModule&utm_medium=copy&utm_content=18&utm_campaign=choosepaypal',0,1),('72',4,'2013-01-15 22:02:07','Imagine 2013 Registration is Now Open!','Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.','https://registration.imagineecommerce.com/',0,1),('73',4,'2013-02-12 17:53:42','Get More eCommerce Power with Magento Enterprise','Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ','http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE',0,1),('74',2,'2013-09-27 17:28:13','Magento Community Edition 1.8.0.0 - now available for download!','Get tax, security, performance, and many other improvements. \n\nLearn more at http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/ ','http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/',0,1),('75',4,'2013-12-11 15:35:06','Magento Community Edition 1.8.1.0 is here!','This new version offers significant tax calculation, product quality, and security enhancements. Be sure to carefully review the upgrade instructions before starting. More information is available at http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/','http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/',0,1),('76',4,'2013-12-12 23:24:39','Important Magento Community Edition Patch','A security patch is available for Magento Community Edition 1.4.0.0 through 1.7.0.2; the issue has been fixed in Magento Community Edition 1.8.0.0 and later. It resolves a vulnerability discovered through our quarterly penetration testing process and has not been reported by merchants. We encourage all merchants to apply the patch in their next regularly scheduled maintenance cycle. The patch is available at http://www.magentocommerce.com/download in the Magento Community Edition Patches section.','http://www.magentocommerce.com/download',0,1),('77',4,'2014-01-21 18:34:48','PHP 5.4 Patch Now Available','Magento is advancing its platform and making development more efficient by adding support for PHP 5.4. Patches are available for download at www.magentocommerce.com/download and you can learn more about this update in our blog post at http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54 .','http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54',0,1),('78',4,'2014-02-20 17:51:46','Discover Card Validation Patch Available','A patch that resolves an issue with validating Discover credit cards is now available for download at http://www.magentocommerce.com/download. More information on the patch is available in the Magento Knowledge Base at http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation','http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation ',0,1),('79',4,'2014-03-04 15:12:26','Learn How to Quickly Increase Sales on Your Site','Adding the PayPal Express Checkout button to your checkout page can help increase sales 18% on average. It’s fast and easy and you can do it right now to boost sales. Express Checkout is already seamlessly integrated into Community Edition.','http://magento.com/paypal/CE_Express_Checkout_NA?utm_source=messagemodule&utm_medium=message&utm_campaign=Ceexpresscheckout',0,1),('80',4,'2008-11-08 04:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1),('81',3,'2014-03-18 17:00:00','Price Match v.2.1 by aheadWorks has been released!','Let customers create a price match request when other vendors offer lower product price. Since version 2.1, visitors’ requests can be approved automatically.','http://ecommerce.aheadworks.com/magento-extensions/price-match.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=pmatch_2_1',0,1),('82',3,'2014-03-17 07:00:00','St. Patrick’s Day Sale – 10% OFF all Magento extensions','Save some green on St. Patrick’s Day! We offer you a 10% discount on all Magento extensions and themes by aheadWorks. The sale is valid only on the 17th of March.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=patrick2014',0,1),('83',3,'2014-03-12 17:00:00','Countdown v.1.1 by aheadWorks has been released!','Get full control over promotional countdown blocks: show them on a recurring basis, prioritize, display inside product list on the category page, and much more.','http://ecommerce.aheadworks.com/magento-extensions/countdown.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=countdown11',0,1),('84',3,'2014-03-05 16:00:00','Layered Navigation v.1.1 by aheadWorks has been released!','Improve Magento search with easy-to-use navigation filters. Since version 1.1, decimal/integer attributes are supported, help notices & column layout can be set up, and much more…','http://ecommerce.aheadworks.com/magento-extensions/layered-navigation.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=ln11',0,1),('85',3,'2014-02-28 17:00:00','Featured Products 3 v.3.6 by aheadWorks has been released!','Showcase top items of your store in a customizable featured products block! Background color, border, and border-radius can be configured in the backend.','http://ecommerce.aheadworks.com/magento-extensions/featured-products-3.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=fp36',0,1),('86',3,'2014-02-26 17:00:00','Advanced Newsletter v.2.4 by aheadWorks has been released! ','Add more security to your emails. Since version 2.4, SSL protocol in SMTP configuration is supported.','http://ecommerce.aheadworks.com/magento-extensions/advanced-newsletter.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=an_2_4',0,1),('87',3,'2014-02-24 17:00:00','RMA v.1.5 by aheadWorks has been released!','Manage customers’ requests for products return or exchange without any efforts. Since version 1.5, you can explain RMA policy to clients while a new request is being created.','http://ecommerce.aheadworks.com/magento-extensions/rma.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=rma_1_5',0,1),('88',3,'2014-02-14 14:00:00','Valentines’ Day Sale – 15% off Magento extensions','Happy Valentine’s Day! Enjoy a 15% discount on all Magento extensions or themes by aheadWorks! The offer is valid only on the 14th of February!','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=valentine',0,1),('89',3,'2014-02-03 17:00:00','Search Autocomplete and Suggest v.3.4 by aheadWorks has been released!','Make your store search instant with relevant results. Now with suggested keywords and ‘All Results’ button.','http://ecommerce.aheadworks.com/magento-extensions/search-autocomplete-and-suggest.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=sas_3_4',0,1),('90',3,'2014-01-16 09:00:00','Advanced Search v.1.4 has been released! ','Make search results even more trustworthy! Since version 1.4, Advanced Search corrects all misspellings and allows customers to find products by part of the word.','http://ecommerce.aheadworks.com/magento-extensions/advanced-search.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=as1_4',0,1),('91',4,'2008-11-08 04:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,0,1),('92',3,'2014-03-26 17:00:00','Shop By Brand v.1.3 by aheadWorks has been released!','Assign products to brands without any efforts! Since version 1.3, you